import React from "react";
import "../App.css";
import ReactPlayer from "react-player";

function Video(props) {
    console.log(props)

    return (
        <div id="VideoContainer">
            <ReactPlayer
                key={props.Name} 
                url={props.link}
                controls={true}
                playsinline={true}
            />
        </div>
    )
}

export default Video;
